            <div className='container mx-auto text-center font-normal text-white'>&copy;Copyright Projeto desenvolvido por: {' '} <a className='hover:underline font-bold' >EOS CREATIVE TECHNOLOGIE</a>
            </div>
        </div>
    )
}
export default Footer
